let baseUrl = 'https://cdn3.riastatic.com/photosnew/auto/photo/__334443128f.jpg';
function App() {
  return (
    <>
        <div className='Car_app'>
            <img src={baseUrl} alt=""/>
            <button>Left</button>
            <button>Right</button>
        </div>

    </>
  );
}

export default App;
